export function ImageQuiz(path) {

    let isQuestion = false;
    if(endsWith(path,"?"))
    {
        isQuestion = true;
    }   
    console.log(true);
    console.log(path);
    return (
        <div>
            {
                isQuestion ? 
                (
                    {path}
                ):(
                <div className="topping">
                    <input type="checkbox" id={path} name="topping" value={path} />
                </div>
                )
            }
        </div>
    );
}

function endsWith(str, suffix) {
    return str.indexOf(suffix, str.length - suffix.length) !== -1;
}
